projects.description:
Spinoza est le système de gestion des connaissances du Contrôle général des Armées.

Contribution sur le projet : Accompagnement et expertise pour l’intégration des solutions d’Antidot dans le projet de management des connaissances au Contrôle général des armées (projet Spinoza)
 - Configuration de la solution Antidot ;
 - Intégration des référentiels métiers mis au point par le CGA avec les technologies du Web sémantique ;
